import "./List.css";
const ListData = (props) => {
  const catg = props.data;
  const clickedItem = (event) => {
    console.log(event.target);
  };
  return (
    <ul class="list-group">

      {catg &&
        catg.length > 0 &&
        catg.map((catg, index) => (
          <div>
          <li
            class="list-group-item"
            key={catg.id}
            onClick={clickedItem}
            id={catg.id}
          >
            <div className="row">
            <div className="text">
              <img
                className="image"
                src={catg.foodCategoryImagepath}
                alt="new"
              />
              </div>
              <div className="text">{catg.name}</div>
            </div>
          </li>
          </div>
        ))}

    </ul>
  );
};

export default ListData;
